import React from "react";
import { Button, Card, CardBody, CardText } from "reactstrap";

function Post({
  postTitle = "This is default post title",
  postContent = "This is default post content",
}) {
  return (
    <Card className="shadow">
      <CardBody>
        <h3>{postTitle}</h3>
        <CardText>
          <p>{postContent}</p>
        </CardText>
        <div>
            <Button>
                Read More
            </Button>
        </div>
      </CardBody>
    </Card>
  );
}

export default Post;
